import React from 'react';

export const ModelItem = ({ model, isSelected, onSelect }) => {
    return (
        <div
            role="menuitem"
            className={`flex items-center m-1.5 p-2.5 text-sm cursor-pointer focus-visible:outline-0 radix-disabled:pointer-events-none radix-disabled:opacity-90 group relative hover:bg-gray-200 dark:hover:bg-zinc-800 focus-visible:bg-zinc-700 radix-state-open:bg-zinc-700 rounded-md py-3 px-3 gap-2.5 border-x-2 border-x-[#00aeff] transition-colors duration-1000 ${isSelected ? 'bg-blue-100 dark:bg-blue-900' : ''
                }`}
            tabIndex="-1"
            onClick={() => onSelect(model.value)}
        >
            <div className="flex grow items-center justify-between gap-2">
                <div className="flex items-center gap-3">
                    {ModelIconSvg(model.icon)}
                    <div>
                        <div className="flex items-center gap-1">
                            {model.name}
                            {model.recommended && (
                                <sup className="text-green-400 font-mono">Recommended</sup>
                            )}
                        </div>
                        <div className="text-gray-500 dark:text-gray-400 text-xs">
                            {model.description}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};



const ModelIconSvg = (icon) => {
    const getIcon = (iconType) => {
        console.log(iconType)
        // Return appropriate SVG based on iconType
        switch (iconType) {
            case 'qwen':
                return <QwenIcon />;
            case 'deepseek':
                return <DeepSeekIcon />;
            case 'microsoft':
                return <MicrosoftIcon />;
            case 'llama':
                return <LlamaIcon />;
            case 'mistral':
                return <MistralIcon />;
            case 'nvidia':
                return <NvidiaIcon />;
            case 'meta':
                return <MetaIcon />;
            case 'nous':
                return <NousResearchIcon />;
            case 'code':
                return <CodeIcon />;
            case 'default':
                return <CodeIcon />;
            case 'cohere':
                <CohereIcon />

            default:
                return null;
        }
    };

    return (
        <span className="max-w-6 max-h-6">
            {getIcon(icon)}
        </span>
    );
};


